import ExpenseTask from "./ExpenseTask";

const ExpenseList = () => {
 if(filtered.length > 0){
  expensesContent = filtered.length > 0 &&  filtered.map((expense) => (
    <Expenseitem
    key = {expense.id}
    title={expense.title}
    rate={expense.rate}
    thatDay={expense.thatDay}
    />
    ));
}
}
 
export default ExpenseList;
